import React from 'react';
import logo from './logo.svg';
import { Counter } from './features/counter/Counter';
import './App.css';
import { Header, Footer } from './components';
import PetCard from './components';

function App() {
  return (
    <div className="App">
      <Header />
      <PetCard/>
      <Footer />
    </div>
  );
}

export default App;
